import React, {Component} from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component{
    state = {
        isLoggedIn: false,
    }
    onClick = (e) => {
        e.preventDefault();
        let style = this.props.actionPathMethod("/register")
        e.target.className.style({textDecoration: "none", color: style})
    }
    render(){
        return(
            <div className="App">
                    <hr/>
                        <h2 style={navTextStyling}>News Products Login <Link className="registerLink" onClick={this.onChange} to="/register">Register</Link></h2>
                    <hr/>            
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "12px"
}


export default Navbar;
